import React from 'react';

const component2 = () => {
   return (
      <div class="text2">
            <p class="designer">I'm a cushion designer</p>
            <p class="california">Based in San Francisco, California I design trendy and fashion Cushions,<br/> since I have memory I always had a tendency to design and illustration.</p>
            <button class="radius">Learn More</button>
        </div>
   );
}

export default component2;
